CREATE TABLE tbase:informix.capig_dbs03_final (
	capignpig serial NOT NULL,
	capigfpig date NOT NULL,
	capigncta char(10) NOT NULL,
	capigcpig decimal(3,0) NOT NULL,
	capigcaut integer,
	capigfvto date,
	capigimpo decimal(14,2) NOT NULL,
	capigglos char(90),
	capigndoc char(15),
	capigmorg decimal(2,0),
	capigtorg decimal(10,0),
	capigstat decimal(1,0),
	capigplaz smallint,
	capigagen smallint,
	capiguser char(3),
	capighora char(8),
	capigfpro date
);

load FROM capig_dbs03.txt INSERT INTO capig_dbs03;

SELECT *
FROM capig a
WHERE a.capigfpro = today
AND EXISTS (SELECT *
			FROM capig_dbs03 b
			WHERE b.capignpig = a.capignpig
			AND b.capigncta = a.capigncta
			AND b.capigimpo = a.capigimpo)

SELECT *
FROM capig_dbs03 a
WHERE a.capigfpro = '2025-02-02'
AND NOT EXISTS (SELECT *
			FROM capig b
			WHERE b.capignpig = a.capignpig
			AND b.capigncta = a.capigncta
			AND b.capigimpo = a.capigimpo)
ORDER BY 3;

DELETE capig_dbs03

SELECT *
FROM capig_dbs03_final
ORDER BY 1 DESC 


